INSERT INTO `cau_tra_loi` (`id`, `cau_tra_loi`, `created_at`, `updated_at`) VALUES
(1, '<p>Địa chỉ: 126 Nguyễn Thiện Th&agrave;nh, Phường H&ograve;a Thuận, tỉnh Vĩnh Long</p>', '2025-08-28 19:42:16', '2025-09-10 03:33:21'),
(2, '<p>Ch&agrave;o bạn. Anh Ho&agrave;ng Nam l&agrave; Trưởng ban Cố vấn của C&acirc;u lạc bộ Truyền th&ocirc;ng TVU. Hỗ trợ c&ocirc;ng t&aacute;c tư vấn tuyển sinh của Trường. Bạn an t&acirc;m về anh n&agrave;y nh&eacute;.</p>', '2025-08-28 19:49:13', '2025-09-10 03:33:31'),
(3, '<p>2025 trường Đại học Tr&agrave; Vinh tuyển sinh <strong>47</strong> ng&agrave;nh, đến <strong>2026</strong> th&igrave; tuyển sinh <strong>50</strong> ng&agrave;nh Mọi chi tiết xin vui l&ograve;ng truy cập: <a title=\"Địa chỉ trang TVU\" href=\"https://tuyensinh.tvu.edu.vn\">https://tuyensinh.tvu.edu.vn</a> hoặc Điện thoại: <strong>0911202707</strong></p>', '2025-08-28 20:12:25', '2025-09-01 12:44:06'),
(4, '<p>Ch&agrave;o bạn. Nếu l&agrave; T&acirc;n sinh vi&ecirc;n, bạn vui l&ograve;ng qu&eacute;t m&atilde; QR tr&ecirc;n phiếu B để thực hiện.</p>', '2025-08-28 20:55:55', '2025-09-10 03:34:09'),
(6, '<p>Ch&agrave;o bạn. Phiếu B l&agrave; phiếu tiếp nhận hồ sơ nhập học. Tr&ecirc;n đ&oacute; sẽ c&oacute; th&ocirc;ng tin c&aacute; nh&acirc;n của sinh vi&ecirc;n.</p>', '2025-08-28 20:59:09', '2025-09-10 03:34:25'),
(7, '<p>Ch&agrave;o bạn. Phiếu B l&agrave; phiếu tiếp nhận hồ sơ nhập học. Tr&ecirc;n đ&oacute; sẽ c&oacute; th&ocirc;ng tin c&aacute; nh&acirc;n của sinh vi&ecirc;n.</p>', '2025-08-28 21:06:13', '2025-09-10 03:34:30'),
(8, '<p>Ch&agrave;o bạn. Phiếu B d&ugrave;ng để x&aacute;c nhận bạn đ&atilde; l&agrave;m thủ tục nhập học tại Trường Đại học Tr&agrave; Vinh.</p>', '2025-08-28 21:07:47', '2025-09-10 03:34:48'),
(9, '<p>Ch&agrave;o bạn. <span style=\"color: #000000;\">Nếu mất phiếu B th&igrave; bạn li&ecirc;n hệ Ph&ograve;ng C&ocirc;ng t&aacute;c Sinh vi&ecirc;n Học sinh để lấy lại m&atilde; QR v&agrave; thực hiện việc cập nhật l&yacute; lịch sinh vi&ecirc;n (đối với trường hợp bị mất sao khi cập nhật l&yacute; lịch sinh vi&ecirc;n) th&igrave; kh&ocirc;ng cần qu&eacute;t lại.</span></p>', '2025-08-28 21:09:36', '2025-09-01 12:51:46'),
(10, '<p>Ch&agrave;o bạn. Để biết m&atilde; số sinh vi&ecirc;n bạn vui l&ograve;ng xem tr&ecirc;n phiếu B.</p>', '2025-08-29 00:32:15', '2025-09-10 03:34:42'),
(11, '<p>Ch&agrave;o bạn. Để biết m&atilde; số sinh vi&ecirc;n bạn vui l&ograve;ng xem tr&ecirc;n phiếu B.</p>', '2025-08-29 00:32:42', '2025-09-10 03:34:39'),
(12, '<p>Ch&agrave;o bạn. Để biết m&atilde; lớp bạn vui l&ograve;ng nh&igrave;n tr&ecirc;n phiếu B.</p>', '2025-08-29 00:33:31', '2025-09-10 03:35:02'),
(13, '<p>Ch&agrave;o bạn. Muốn xin chuyển lớp, bạn vui l&ograve;ng li&ecirc;n hệ trực tiếp tại Ph&ograve;ng C&ocirc;ng t&aacute;c Sinh vi&ecirc;n Học sinh nh&eacute;.</p>', '2025-08-29 00:34:30', '2025-09-10 03:35:14'),
(14, '<p>Ch&agrave;o bạn. Để xem sơ đồ c&aacute;c Khu của Trường Đại học Tr&agrave; Vinh bạn vui l&ograve;ng xem tại: 👉Sơ đồ ph&ograve;ng học tại Khu 1 (đường Nguyễn Thiện Th&agrave;nh, phường H&ograve;a Thuận): https://ttsv.tvu.edu.vn/api/fileManager?src=2024/Thang%2009/SoDoKhuI-WEB.pdf 👉 Sơ đồ ph&ograve;ng học tại Khu 2 (đường Ki&ecirc;n Thị Nhẫn, phường Nguyệt H&oacute;a): https://ttsv.tvu.edu.vn/api/fileManager?src=2024/Thang%2009/khu2.pdf ⛔ Lưu &yacute;: Ph&ograve;ng học c&oacute; m&atilde;: HTE, PH07, PH08, PH09, PH10, ...l&agrave; ph&ograve;ng học thuộc Trường Cao đẳng Y tế Tr&agrave; Vinh (kế b&ecirc;n Bệnh viện Trường Đại học Tr&agrave; Vinh)</p>', '2025-08-29 00:36:18', '2025-09-10 03:35:33'),
(15, '<p>Ch&agrave;o bạn. Giảng đường 1000 chổ hay c&ograve;n gọi l&agrave; Giảng đường D51.101 nằm gần s&acirc;n b&oacute;ng đ&aacute; cỏ nh&acirc;n tạo. Từ cổng Khu 1 đi thẳng qua nh&agrave; xe sinh vi&ecirc;n sau đ&oacute; quẹo phải đi thẳng tầm 200m. Nh&igrave;n b&ecirc;n tay phải sẽ thấy.</p>', '2025-08-29 00:39:40', '2025-09-10 03:35:41'),
(16, '<p>Ch&agrave;o bạn. Giảng đường D5 (d51.101) hay c&ograve;n gọi l&agrave; Giảng đường 1000 chổ nằm gần s&acirc;n b&oacute;ng đ&aacute; cỏ nh&acirc;n tạo. Từ cổng Khu 1 đi thẳng qua nh&agrave; xe sinh vi&ecirc;n sau đ&oacute; quẹo phải đi thẳng tầm 200m. Nh&igrave;n b&ecirc;n tay phải sẽ thấy.</p>', '2025-08-29 00:40:52', '2025-09-10 03:35:49'),
(17, '<p>Ch&agrave;o bạn. Để đ&oacute;ng học ph&iacute; bạn vui l&ograve;ng li&ecirc;n hệ Ph&ograve;ng T&agrave;i ch&iacute;nh hoặc xem hướng dẫn chuyển khoản trong th&ocirc;ng th&ocirc;ng b&aacute;o thu.</p>', '2025-08-29 00:45:50', '2025-09-10 03:35:58'),
(18, 'Chào bạn. Để xét tuyển đợt 2 (đợt bổ sung) tại Trường Đại học Trà Vinh. Thí sinh không xác nhận nhập học trên hệ thống Bộ. Trường hợp nếu đã xác nhận nhập học trên hệ thống Bộ, thí sinh liên hệ với Trường đã xác nhận để hủy nhập học.\n- Thí sinh lưu ý: Trường chỉ xét tuyển đối với những ngành còn thiếu chỉ tiêu đợt 1. Thí sinh vui lòng tìm hiểu và xem thông báo tuyển sinh của Trường.', '2025-08-29 00:49:31', '2025-08-29 07:49:31'),
(19, '<p>Ch&agrave;o bạn. Fanpage Facebook của Trường Đại học Tr&agrave; Vinh tại địa chỉ: https://www.facebook.com/TraVinhUniversity.TVU</p>', '2025-08-29 00:50:37', '2025-09-10 03:40:46'),
(20, '<p>Ch&agrave;o bạn. Muốn xin giấy x&aacute;c nhận tạm ho&atilde;n nghĩa vụ qu&acirc;n sự, sinh vi&ecirc;n đăng nhập bằng t&agrave;i khoản mail sinh vi&ecirc;n tr&ecirc;n hệ thống: https://onegate.tvu.edu.vn:10042 v&agrave; tiến h&agrave;nh đăng k&yacute; giấy.</p>', '2025-08-29 00:52:28', '2025-09-10 03:40:37'),
(21, '<p>Ch&agrave;o bạn. Trường Đại học Tr&agrave; Vinh l&agrave; trường đại học C&Ocirc;NG LẬP trực thuộc UBND tỉnh Vĩnh Long.</p>', '2025-08-29 00:54:38', '2025-09-10 03:40:32'),
(22, '<p>Trường Đại học Tr&agrave; Vinh được h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển từ Trường Cao đẳng Cộng đồng Tr&agrave; Vinh. Sau 5 năm triển khai th&agrave;nh c&ocirc;ng Dự &aacute;n Cao đẳng Cộng đồng Việt Nam &ndash; Canada do ch&iacute;nh phủ Canada v&agrave; Ch&iacute;nh phủ Việt Nam đồng t&agrave;i trợ, c&ugrave;ng với nhu cầu cấp thiết về ph&aacute;t triển gi&aacute;o dục v&agrave; đ&agrave;o tạo của tỉnh nh&agrave; cũng như nhu cầu về nguồn nh&acirc;n lực thực hiện chiến lược ph&aacute;t triển kinh tế, văn h&oacute;a, x&atilde; hội khu vực Đồng bằng s&ocirc;ng Cửu Long v&agrave; cả nước, Trường Đại học Tr&agrave; Vinh được ch&iacute;nh thức th&agrave;nh lập theo Quyết định 141/QĐ/2006-TTg ng&agrave;y 19/6/2006 của Thủ tướng ch&iacute;nh phủ v&agrave; trở th&agrave;nh một trong những trường đại học C&Ocirc;NG LẬP trong hệ thống gi&aacute;o dục đại học Việt Nam.</p>\n<p>Trường vừa l&agrave; th&agrave;nh vi&ecirc;n hiệp hội quốc tế đại học, cao đẳng Canada vừa l&agrave; th&agrave;nh vi&ecirc;n của tổ chức CDIO, top 200 trường đại học xanh, ph&aacute;t triển bền vững, theo UI Greenmetric World University Rankings, Top 100 của WURI Ranking &ndash; trường c&oacute; ảnh hưởng v&agrave; đ&oacute;ng g&oacute;p t&iacute;ch cực cho x&atilde; hội<strong>,&nbsp;</strong>cũng như đạt chuẩn kiểm định chất lượng cơ sở gi&aacute;o dục theo bộ ti&ecirc;u ch&iacute; mới của Bộ GD&amp;ĐT, kiểm định FIBAA, AUN, ABET,&hellip;</p>\n<p>Trường đ&atilde; v&agrave; đang hoạt động theo m&ocirc; h&igrave;nh đa ng&agrave;nh, đa phương thức đ&agrave;o tạo từ bậc cao đẳng, đại học, sau đại học, với nhiệm vụ đ&agrave;o tạo v&agrave; cung cấp nguồn nh&acirc;n lực c&oacute; tay nghề cao, nghi&ecirc;n cứu khoa học v&agrave; ứng dụng; cung cấp c&aacute;c dịch vụ g&oacute;p phần v&agrave;o sự nghiệp ph&aacute;t triển gi&aacute;o dục, kinh tế, văn ho&aacute;, x&atilde; hội của tỉnh Tr&agrave; Vinh v&agrave; khu vực Đồng bằng s&ocirc;ng Cửu Long n&oacute;i ri&ecirc;ng cũng như cả nước n&oacute;i chung.</p>\n<p>Ng&agrave;y 13/04/2017 &ndash; Thủ tướng Ch&iacute;nh phủ đ&atilde; ph&ecirc; duyệt Đề &aacute;n th&iacute; điểm đổi mới cơ chế hoạt động của Trường Đại học Tr&agrave; Vinh, với mục ti&ecirc;u của đề &aacute;n l&agrave; ph&aacute;t triển Trường Đại học Tr&agrave; Vinh th&agrave;nh trường đại học định hướng ứng dụng theo c&aacute;c chuẩn mực khu vực v&agrave; quốc tế; hoạt động tự chủ gắn với tr&aacute;ch nhiệm bảo đảm c&aacute;c đối tượng ch&iacute;nh s&aacute;ch, đối tượng thuộc hộ ngh&egrave;o c&oacute; cơ hội học tập, nghi&ecirc;n cứu tại Trường.</p>\n<p>Xem th&ecirc;m th&ocirc;ng tin vui l&ograve;ng truy cập: <a href=\"https://www.tvu.edu.vn/lich-su-phat-trien/\">https://www.tvu.edu.vn/lich-su-phat-trien/</a></p>', '2025-09-08 19:41:40', '2025-09-09 02:46:06'),
(23, '<p>L&agrave; đại học ti&ecirc;n tiến định hướng ứng dụng điển h&igrave;nh xuất sắc, đặc th&ugrave;, hội nhập quốc tế.</p>', '2025-09-08 19:42:03', '2025-09-09 02:42:03'),
(24, '<p>Trường Đại học Tr&agrave; Vinh đ&agrave;o tạo đa ng&agrave;nh, đa cấp, li&ecirc;n th&ocirc;ng, đ&aacute;p ứng đa dạng nhu cầu của người học; nghi&ecirc;n cứu khoa học; ph&aacute;t triển ứng dụng, chuyển giao c&ocirc;ng nghệ, phục vụ x&atilde; hội; g&oacute;p phần quan trọng l&agrave;m tăng cơ hội việc l&agrave;m, th&uacute;c đẩy tỉnh thần đổi mới s&aacute;ng tạo v&agrave; khởi nghiệp, n&acirc;ng cao chất lượng cuộc sống của cộng đồng v&agrave; th&uacute;c đ&acirc;y ph&aacute;t triển kinh tế &ndash; x&atilde; hội của địa phương v&agrave; cả nước.</p>', '2025-09-08 19:42:29', '2025-09-09 02:42:29'),
(25, '<p>Người học th&agrave;nh đạt; Vi&ecirc;n chức hạnh ph&uacute;c; Nh&agrave; trường chất lượng; Cộng đồng ph&aacute;t triển</p>', '2025-09-08 19:42:46', '2025-09-09 02:42:46'),
(26, '<p>Tận t&acirc;m &ndash; Minh bạch &ndash;&nbsp; Th&acirc;n thiện &ndash; S&aacute;ng tạo</p>', '2025-09-08 19:43:21', '2025-09-09 02:43:21'),
(27, '<p>&ldquo;Mang đến cơ hội học tập chất lượng cho cộng đồng&rdquo;</p>', '2025-09-08 19:43:46', '2025-09-09 02:43:46'),
(28, '<p><em>&ldquo;Tr&ecirc;n cơ sở năng lực được đ&agrave;o tạo ph&ugrave; hợp thực tế, c&oacute; đạo đức, c&oacute; tr&aacute;ch nhiệm, người học sẽ ph&aacute;t triển c&aacute; nh&acirc;n v&agrave; x&atilde; hội tốt hơn&rdquo;</em></p>\n<p>Trường Đại học Tr&agrave; Vinh tin rằng gi&aacute;o dục v&agrave; đ&agrave;o tạo l&agrave; nền tảng của x&atilde; hội, kết quả của gi&aacute;o dục v&agrave; đ&agrave;o tạo kh&ocirc;ng chỉ l&agrave;m ph&aacute;t triển c&aacute; nh&acirc;n, hướng tới cuộc sống tốt hơn m&agrave; c&ograve;n th&uacute;c đẩy sự ph&aacute;t triển của to&agrave;n x&atilde; hội.</p>\n<p>Chương tr&igrave;nh đ&agrave;o tạo của Trường được thiết kế v&agrave; ph&aacute;t triển theo hướng đ&agrave;o tạo năng lực cho người học với khối lượng kiến thức, kỹ năng v&agrave; th&aacute;i độ được tham vấn từ c&aacute;c b&ecirc;n li&ecirc;n quan (gồm doanh nghiệp, đơn vị tuyển dụng, người l&agrave;nh nghề, c&aacute;c nh&agrave; khoa học, giảng vi&ecirc;n, sinh vi&ecirc;n, &hellip;) nhằm đảm bảo người học được trang bị năng lực ph&ugrave; hợp thực tế để tham gia v&agrave;o lực lượng lao động của x&atilde; hội.</p>\n<p>Nh&agrave; trường tin rằng việc x&acirc;y dựng hệ thống giảng dạy v&agrave; học tập tr&ecirc;n cơ sở&nbsp;<strong>Người học l&agrave; trung t&acirc;m</strong>&nbsp;(Student &ndash; Centered) sẽ tạo điều kiện thuận lợi nhất cho người học hoạch định kế hoạch học tập ph&ugrave; hợp để ph&aacute;t huy tiềm năng, thế mạnh của m&igrave;nh cũng như th&uacute;c đẩy qu&aacute; tr&igrave;nh tự r&egrave;n luyện v&agrave; tinh thần tr&aacute;ch nhiệm với việc học tập của bản th&acirc;n, qua đ&oacute; h&igrave;nh th&agrave;nh nhận thức v&agrave; khả năng học tập suốt đời.</p>\n<p>Trường Đại học Tr&agrave; Vinh x&aacute;c định việc đ&agrave;o tạo kỹ năng cho người học theo định hướng như sau: Năng lực của người học sẽ dần được h&igrave;nh th&agrave;nh th&ocirc;ng qua việc học tập v&agrave; r&egrave;n luyện kỹ năng chuy&ecirc;n m&ocirc;n với hệ thống thực h&agrave;nh, th&iacute; nghiệm tại ph&ograve;ng th&iacute; nghiệm, c&aacute;c trạm, trại thực h&agrave;nh; c&ugrave;ng qu&aacute; tr&igrave;nh thực tập thực tế tại c&aacute;c doanh nghiệp, cơ quan đơn vị theo m&ocirc; h&igrave;nh kết hợp đ&agrave;o tạo (CO-OP). B&ecirc;n cạnh đ&oacute;, để th&uacute;c đẩy n&acirc;ng cao năng lực học tập của người học một c&aacute;ch t&iacute;ch cực, Trường tạo mọi điều kiện thuận lợi từ sự hỗ trợ của giảng vi&ecirc;n đến sự hỗ trợ kinh ph&iacute; để người học chủ động thực hiện c&aacute;c đề t&agrave;i, dự &aacute;n nghi&ecirc;n cứu khoa học theo chuy&ecirc;n ng&agrave;nh được đ&agrave;o tạo; tiếp cận c&aacute;c vấn đề thực tế của x&atilde; hội, sự ph&aacute;t triển của khoa học, c&ocirc;ng nghệ, c&aacute;c th&aacute;ch thức của thời đại, &hellip; v&agrave; tham gia c&aacute;c hoạt động phục vụ cộng đồng.</p>\n<p>B&ecirc;n cạnh ph&aacute;t triển kỹ năng chuy&ecirc;n m&ocirc;n, việc r&egrave;n luyện kỹ năng hỗ trợ, đạo đức nghề nghiệp v&agrave; tr&aacute;ch nhiệm với x&atilde; hội c&oacute; vai tr&ograve; rất quan trọng. Trường Đại học Tr&agrave; Vinh tin rằng: đ&acirc;y ch&iacute;nh l&agrave; c&ocirc;ng cụ thiết yếu gi&uacute;p người học tương t&aacute;c với x&atilde; hội, triển khai &aacute;p dụng kiến thức, kỹ năng chuy&ecirc;n m&ocirc;n v&agrave;o hoạt động nghề nghiệp. Do đ&oacute;, nh&oacute;m c&aacute;c kỹ năng hỗ trợ, đạo đức nghề nghiệp v&agrave; tr&aacute;ch nhiệm với x&atilde; hội được thiết kế t&iacute;ch hợp v&agrave;o chương tr&igrave;nh đ&agrave;o tạo của Nh&agrave; trường.&nbsp;&nbsp;</p>', '2025-09-08 19:44:14', '2025-09-09 02:44:14'),
(29, '<p>Tr&ecirc;n cơ sở kế thừa th&agrave;nh quả từ Dự &aacute;n Cao đẳng Cộng đồng Việt Nam &ndash; Canada, c&ugrave;ng với định hướng ph&aacute;t triển đ&agrave;o tạo theo xu thế hội nhập quốc tế, x&aacute;c định hợp t&aacute;c quốc tế l&agrave; một trong những nhiệm vụ chiến lược ph&aacute;t triển của nh&agrave; trường, nh&agrave; trường chủ động, t&iacute;ch cực trong việc thiết lập c&aacute;c mối quan hệ v&agrave; đ&atilde; ch&iacute;nh thức k&yacute; kết, giao lưu hợp t&aacute;c với gần 100 đối t&aacute;c nước ngo&agrave;i thuộc 18 quốc gia tr&ecirc;n thế giới, hợp t&aacute;c ở c&aacute;c lĩnh vực cụ thể như: Li&ecirc;n kết đ&agrave;o tạo; nghi&ecirc;n cứu khoa học, tổ chức diễn đ&agrave;n, hội thảo khoa học; tiếp nhận v&agrave; đưa giảng vi&ecirc;n, sinh vi&ecirc;n học tập, nghi&ecirc;n cứu; tiếp nhận t&igrave;nh nguyện vi&ecirc;n; tiếp nhận c&aacute;c dự &aacute;n t&agrave;i trợ từ một số tổ chức gi&aacute;o dục quốc tế.</p>', '2025-09-08 19:44:48', '2025-09-09 02:44:48'),
(30, '<p>Trang web ch&iacute;nh thức: <a href=\"https://www.tvu.edu.vn/\">https://www.tvu.edu.vn/</a></p>\n<p>Trang tuyển sinh: <a href=\"https://tuyensinh.tvu.edu.vn/\">https://tuyensinh.tvu.edu.vn/</a></p>', '2025-09-08 19:47:50', '2025-09-09 02:47:50'),
(31, '<p><strong>Trường ĐH Tr&agrave; Vinh đạt chứng nhận kiểm định trong nước, quốc tế v&agrave; xếp hạng trường</strong></p>\n<div>\n<p>Trường ĐH Tr&agrave; Vinh đạt chứng nhận kiểm định chất lượng cấp cơ sở gi&aacute;o dục theo bộ ti&ecirc;u ch&iacute; mới của Bộ GD&amp;ĐT với 25 ti&ecirc;u chuẩn, 111 ti&ecirc;u ch&iacute; ở 4 nh&oacute;m lĩnh vực gồm: Đảm bảo chất lượng về chiến lược, Đảm bảo chất lượng về hệ thống, Đảm bảo chất lượng về thực hiện chức năng (đ&agrave;o tạo, nghi&ecirc;n cứu khoa học, phục vụ cộng đồng) v&agrave; Kết quả hoạt động &ndash; Trung T&acirc;m kiểm định chất lượng gi&aacute;o dục Đại học Quốc gia TP. HCM, 11/2019.</p>\n<p>Hiện nay, Trường c&oacute;&nbsp;<strong>27</strong>&nbsp;chương tr&igrave;nh đạt kiểm định chất lượng gi&aacute;o dục quốc tế&nbsp;<strong>FIBAA, AUN-QA, ABET</strong>,&nbsp;<strong>01</strong>&nbsp;chương tr&igrave;nh đạt chứng nhận kiểm định chất lượng theo ti&ecirc;u chuẩn của&nbsp;<strong>Bộ GD&amp;ĐT (MOET)</strong>, g&oacute;p phần đưa TVU v&agrave;o top c&aacute;c trường đại học ở ĐBSCL c&oacute; nhiều chương tr&igrave;nh đạt kiểm định chất lượng gi&aacute;o dục quốc tế.</p>\n<p><strong>11</strong>&nbsp;chương tr&igrave;nh đạt kiểm định chất lượng gi&aacute;o dục quốc tế&nbsp;<strong>FIBAA</strong> gồm: Quản trị kinh doanh, Kế to&aacute;n, Kinh t&ecirc;́, T&agrave;i ch&iacute;nh ng&acirc;n h&agrave;ng, Luật, Quản l&yacute; Thể dục Thể thao, Quản trị Văn ph&ograve;ng, Thạc sĩ Quản l&yacute; Kinh tế, Thạc sĩ Quản trị kinh doanh, Thạc sĩ Quản l&yacute; Y tế, Thạc sĩ Quản l&yacute; Gi&aacute;o dục.</p>\n<p><strong>12</strong>&nbsp;chương tr&igrave;nh đ&agrave;o tạo của Trường Đại học Tr&agrave; Vinh kiểm định chất lượng gi&aacute;o dục quốc tế&nbsp;<strong>AUN-QA</strong> l&agrave;: N&ocirc;ng nghiệp, Nu&ocirc;i trồng Thủy sản, Th&uacute; y, C&ocirc;ng nghệ thực phẩm, Điều dưỡng, Kỹ thuật x&eacute;t nghiệm y học, Dược học, Ng&ocirc;n ngữ Khmer, Ng&ocirc;n ngữ Anh, Gi&aacute;o dục mầm non, Gi&aacute;o dục tiểu học, Th.S Văn ho&aacute;.</p>\n<p><strong>04</strong>&nbsp;chương tr&igrave;nh đạt chuẩn<strong>&nbsp;ABET</strong>&nbsp;(Hoa Kỳ): C&ocirc;ng nghệ th&ocirc;ng tin, C&ocirc;ng nghệ Kỹ thuật C&ocirc;ng tr&igrave;nh X&acirc;y dựng, C&ocirc;ng nghệ Kỹ thuật Cơ kh&iacute;, C&ocirc;ng nghệ Kỹ thuật Điện &ndash; Điện tử.</p>\n<p>V&agrave;&nbsp;<strong>01</strong>&nbsp;chương tr&igrave;nh đạt chứng nhận kiểm định chất lượng theo ti&ecirc;u chuẩn của<strong>&nbsp;Bộ GD&amp;ĐT (MOET)</strong>&nbsp;l&agrave; ng&agrave;nh<strong>&nbsp;RĂNG H&Agrave;M MẶT</strong>.</p>\n</div>', '2025-09-08 19:50:22', '2025-09-09 02:50:22'),
(32, '<p>Vui l&ograve;ng xem chi tiết tại đ&acirc;y: <a href=\"https://tuyensinh.tvu.edu.vn/tai-sao-chon-dh-tra-vinh/\">https://tuyensinh.tvu.edu.vn/tai-sao-chon-dh-tra-vinh/</a></p>', '2025-09-08 19:51:50', '2025-09-09 02:51:50'),
(33, '<p><strong>Trường Đại học Tr&agrave; Vinh ti&ecirc;n phong chuyển đổi số</strong></p>\n<p>03 năm li&ecirc;n tiếp (2022, 2023, 2024), Trường Đại học Tr&agrave; Vinh (ĐHTV) đạt giải thưởng chuyển đổi số xuất sắc do Hội Truyền th&ocirc;ng số Việt Nam v&agrave; Tạp ch&iacute; điện tử VietTimes tổ chức. Đ&acirc;y l&agrave; kết quả của sự nỗ lực v&agrave; th&agrave;nh tựu nổi bật của Trường trong việc ứng dụng c&ocirc;ng nghệ th&ocirc;ng tin, chuyển đổi số v&agrave;o c&aacute;c mặt c&ocirc;ng t&aacute;c.</p>\n<p>Xem chi tiết vui l&ograve;ng truy cập: <a href=\"https://www.tvu.edu.vn/truong-dai-hoc-tra-vinh-tien-phong-chuyen-doi-so/\">https://www.tvu.edu.vn/truong-dai-hoc-tra-vinh-tien-phong-chuyen-doi-so/</a></p>\n<p><strong>Trường ĐH Tr&agrave; Vinh tiếp tục thăng hạng 29 trong Top 400 của WURI Ranking 2025</strong></p>\n<p>TVU &ndash; Li&ecirc;n minh c&aacute;c trường đại học thế giới vừa c&ocirc;ng bố xếp hạng c&aacute;c trường đại học s&aacute;ng tạo c&oacute; tầm ảnh hưởng thật sự, World Universities with Real Impact(WURI). Năm nay, c&oacute; 1252 Trường ĐH tham gia xếp hạng, tăng nhiều hơn 180 trường so với năm 2024.</p>\n<p>Theo đ&oacute;, Trường Đại học Tr&agrave; Vinh tiếp tục thăng hạng trong năm 2025, xếp hạng 29 trong Top 400 trường c&oacute; ảnh hưởng, đ&oacute;ng g&oacute;p cho x&atilde; hội, tăng 13 bậc so với năm 2024 &ndash; TVU xếp hạng 42 trong Top 100. Đ&acirc;y l&agrave; năm thứ 6 li&ecirc;n tiếp, Trường ĐH Tr&agrave; Vinh tiếp tục thăng hạng trong tốp 100 v&agrave; tốp 400 trường.</p>\n<p>Xem chi tiết vui l&ograve;ng truy cập: <a href=\"https://www.tvu.edu.vn/truong-dh-tra-vinh-tiep-tuc-thang-hang-29-trong-top-400-cua-wuri-ranking-2025/\">https://www.tvu.edu.vn/truong-dh-tra-vinh-tiep-tuc-thang-hang-29-trong-top-400-cua-wuri-ranking-2025/</a></p>\n<p><strong>TVU hướng tới một trường đại học xanh to&agrave;n diện</strong></p>\n<p>Trường Đại học Tr&agrave; Vinh ph&aacute;t triển &ldquo;Đại học XANH&rdquo; bền vững qua 9 năm k&yacute; tuy&ecirc;n bố Talloires; v&agrave; l&agrave; 1 trong 2 trường đại học duy nhất ở Việt Nam bốn năm liền lọt v&agrave;o Top 200 Đại học XANH PH&Aacute;T TRIỂN BỀN VỮNG v&agrave; nhiều đ&oacute;ng g&oacute;p cho x&atilde; hội &ndash; UI Greenmetric World University Rankings xếp hạng. Năm 2023, Trường ĐH Tr&agrave; Vinh tiếp tục thăng hạng 43 trong Top 100 c&aacute;c trường c&oacute; ảnh hưởng v&agrave; đ&oacute;ng g&oacute;p t&iacute;ch cực cho x&atilde; hội, gi&aacute; trị khởi nghiệp v&agrave; đổi mới s&aacute;ng tạo, chuyển đổi số v&agrave; mở rộng hợp t&aacute;c, trao đổi sinh vi&ecirc;n quốc tế (tăng 19 bậc so với năm 2022; tăng 28 bậc so với với năm 2021; tăng 43 bậc so với năm 2020), tr&ecirc;n bảng xếp hạng WURI Ranking 2023. Trường Đại học Tr&agrave; Vinh tiếp tục thăng hạng trong năm 2024, xếp hạng 42 trong Top 100.</p>', '2025-09-08 19:54:28', '2025-09-09 02:59:58'),
(34, '<p>Vui l&ograve;ng truy cập tại đ&acirc;y: <a href=\"https://tuyensinh.tvu.edu.vn/chinh-sach-ho-tro-sinh-vien/\">https://tuyensinh.tvu.edu.vn/chinh-sach-ho-tro-sinh-vien/</a></p>', '2025-09-08 20:02:31', '2025-09-09 03:02:31'),
(35, '<p>Xem chi tiết tại đ&acirc;y:<a href=\"https://tuyensinh.tvu.edu.vn/ke-hoach-nam-hoc-danh-cho-sinh-vien-khoa-2025/\"> https://tuyensinh.tvu.edu.vn/ke-hoach-nam-hoc-danh-cho-sinh-vien-khoa-2025/</a></p>', '2025-09-08 20:04:47', '2025-09-09 03:04:47'),
(36, '<p>Vui l&ograve;ng truy cập tại đ&acirc;y: <a href=\"https://tuyensinh.tvu.edu.vn/category/de-an-tuyen-sinh/\">https://tuyensinh.tvu.edu.vn/category/de-an-tuyen-sinh/</a></p>', '2025-09-08 20:15:59', '2025-09-09 03:15:59'),
(37, '<p data-start=\"192\" data-end=\"358\">📌 <strong data-start=\"195\" data-end=\"356\">HỌC PH&Iacute; V&Agrave; CH&Iacute;NH S&Aacute;CH (theo Th&ocirc;ng b&aacute;o số 3251/TB-ĐHTV ng&agrave;y 28/8/2025 của Hiệu trưởng Trường Đại học Tr&agrave; Vinh về việc x&eacute;t tuyển ĐH ch&iacute;nh quy Đợt 1 &ndash; năm 2025)</strong></p>\n<p data-start=\"360\" data-end=\"636\">Học ph&iacute; v&agrave; c&aacute;c khoản thu được &aacute;p dụng theo quy định chung của Trường, đơn gi&aacute; được quy định cụ thể cho từng năm học. Sinh vi&ecirc;n nộp học ph&iacute; theo số t&iacute;n chỉ đăng k&yacute; trong từng học kỳ, mức dao động từ <strong data-start=\"558\" data-end=\"596\">20 &ndash; 35 triệu đồng/học kỳ đầu ti&ecirc;n</strong> t&ugrave;y ng&agrave;nh. C&ocirc;ng thức t&iacute;nh học ph&iacute; l&agrave;:</p>\n<p data-start=\"638\" data-end=\"691\">👉 <em data-start=\"641\" data-end=\"689\">Học ph&iacute; = Số t&iacute;n chỉ đăng k&yacute; x Đơn gi&aacute; t&iacute;n chỉ</em></p>\n<p data-start=\"693\" data-end=\"880\">Đơn gi&aacute; t&iacute;n chỉ gồm học phần chung khối đại cương v&agrave; học phần chuy&ecirc;n ng&agrave;nh. V&iacute; dụ: học ph&iacute; t&iacute;n chỉ khối đại cương bậc ĐH l&agrave; <strong data-start=\"817\" data-end=\"841\">500.000 đồng/t&iacute;n chỉ</strong>, bậc CĐ l&agrave; <strong data-start=\"853\" data-end=\"877\">390.000 đồng/t&iacute;n chỉ</strong>.</p>\n<ul data-start=\"882\" data-end=\"1727\">\n<li data-start=\"882\" data-end=\"1048\">\n<p data-start=\"884\" data-end=\"1048\">C&aacute;c ng&agrave;nh khối Kinh tế &ndash; Luật, Quản trị kinh doanh, T&agrave;i ch&iacute;nh &ndash; Ng&acirc;n h&agrave;ng, Kế to&aacute;n c&oacute; mức từ <strong data-start=\"977\" data-end=\"1007\">17,7 &ndash; 19,5 triệu đồng/năm</strong>, tương ứng <strong data-start=\"1019\" data-end=\"1045\">545 &ndash; 600 ng&agrave;n/t&iacute;n chỉ</strong>.</p>\n</li>\n<li data-start=\"1049\" data-end=\"1272\">\n<p data-start=\"1051\" data-end=\"1272\">C&aacute;c ng&agrave;nh thuộc nh&oacute;m CNTT, Kỹ thuật, Khoa học tự nhi&ecirc;n, N&ocirc;ng nghiệp&hellip; mức trung b&igrave;nh khoảng <strong data-start=\"1142\" data-end=\"1168\">20 &ndash; 22 triệu đồng/năm</strong>, tương ứng <strong data-start=\"1180\" data-end=\"1206\">595 &ndash; 655 ng&agrave;n/t&iacute;n chỉ</strong>. Ri&ecirc;ng ng&agrave;nh CNTT t&iacute;ch hợp tiếng Anh l&agrave; <strong data-start=\"1247\" data-end=\"1269\">1,19 triệu/t&iacute;n chỉ</strong>.</p>\n</li>\n<li data-start=\"1273\" data-end=\"1393\">\n<p data-start=\"1275\" data-end=\"1393\">Ng&agrave;nh C&ocirc;ng nghệ kỹ thuật &ocirc; t&ocirc;, Ng&ocirc;n ngữ Anh, C&ocirc;ng nghệ kỹ thuật điện &ndash; điện tử c&oacute; mức từ <strong data-start=\"1364\" data-end=\"1390\">21 &ndash; 22 triệu đồng/năm</strong>.</p>\n</li>\n<li data-start=\"1394\" data-end=\"1536\">\n<p data-start=\"1396\" data-end=\"1536\">Nh&oacute;m ng&agrave;nh Sức khỏe: Kỹ thuật Y học, Điều dưỡng, X&eacute;t nghiệm&hellip; dao động từ <strong data-start=\"1469\" data-end=\"1495\">34 &ndash; 40 triệu đồng/năm</strong>, khoảng <strong data-start=\"1504\" data-end=\"1533\">885 &ndash; 1,065 triệu/t&iacute;n chỉ</strong>.</p>\n</li>\n<li data-start=\"1537\" data-end=\"1727\">\n<p data-start=\"1539\" data-end=\"1727\">Nh&oacute;m Y &ndash; Dược: Y khoa, Răng H&agrave;m Mặt c&oacute; mức cao nhất, <strong data-start=\"1592\" data-end=\"1615\">63,8 triệu đồng/năm</strong> (tương ứng <strong data-start=\"1627\" data-end=\"1649\">1,56 triệu/t&iacute;n chỉ</strong>). Dược học v&agrave; H&oacute;a dược lần lượt khoảng <strong data-start=\"1689\" data-end=\"1724\">40,4 triệu v&agrave; 27 triệu đồng/năm</strong>.</p>\n</li>\n</ul>\n<p data-start=\"1729\" data-end=\"1903\">Lưu &yacute;: c&aacute;c t&iacute;n chỉ <strong data-start=\"1748\" data-end=\"1757\">Co-op</strong> được t&iacute;nh bằng <strong data-start=\"1773\" data-end=\"1784\">1,1 lần</strong> học ph&iacute; t&iacute;n chỉ chuy&ecirc;n ng&agrave;nh tương ứng. Mức thu thực tế mỗi học kỳ phụ thuộc v&agrave;o số lượng t&iacute;n chỉ sinh vi&ecirc;n đăng k&yacute;.</p>\n<p data-start=\"1905\" data-end=\"2064\">🎯 Về lộ tr&igrave;nh, học ph&iacute; c&oacute; thể điều chỉnh tăng h&agrave;ng năm, nhưng kh&ocirc;ng qu&aacute; <strong data-start=\"1978\" data-end=\"2017\">10% so với năm học liền kề trước đ&oacute;</strong> v&agrave; được c&ocirc;ng khai trước khi bắt đầu năm học.</p>\n<p data-start=\"2066\" data-end=\"2364\">🎓 Ngo&agrave;i ra, sinh vi&ecirc;n c&oacute; nhiều cơ hội nhận <strong data-start=\"2110\" data-end=\"2131\">c&aacute;c loại học bổng</strong>: Học bổng khuyến kh&iacute;ch học tập, học bổng &Ocirc;ng B&agrave; GS Nguyễn Thiện Th&agrave;nh, học bổng AHLS Nguyễn Th&aacute;i B&igrave;nh, học bổng to&agrave;n phần từ c&aacute;c nh&agrave; t&agrave;i trợ, học bổng Fondation de la Chneli&egrave;re (V&otilde; Văn Trường) c&ugrave;ng nhiều học bổng thường ni&ecirc;n kh&aacute;c.</p>', '2025-09-08 20:27:19', '2025-09-09 03:27:19');

